import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Search for a product
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone 15 Pro Max');
    await page.click('.search-btn');
    await page.waitForSelector('.products-grid', { timeout: 5000 });

    // Take screenshot after search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Add first product to cart
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.click('.product-card');
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });
    await page.click('.add-to-cart');

    // Take screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_added_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_added_to_cart.png'));

    // Proceed to checkout
    await page.waitForSelector('.checkout-btn', { timeout: 5000 });
    await page.click('.checkout-btn');

    // Take screenshot at checkout
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_checkout.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_checkout.png'));

    return {
      success: true,
      action: "Completed rapid cart manipulation stress test",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
